import React from "react";
import "./Styles/humans.css";

export const Men = () => {
  return (
    <div className="humans-container">
      <div className="head">
        <p>Sneakers for {document.title}</p>
        <input type="text" />
      </div>
    </div>
  );
};

export default Men;
